CREATE TABLE IF NOT EXISTS "__EFMigrationsHistory" (
    "MigrationId" character varying(150) NOT NULL,
    "ProductVersion" character varying(32) NOT NULL,
    CONSTRAINT "PK___EFMigrationsHistory" PRIMARY KEY ("MigrationId")
);

START TRANSACTION;

CREATE TABLE "Allergens" (
    "Id" integer GENERATED BY DEFAULT AS IDENTITY,
    "Name" text NULL,
    CONSTRAINT "PK_Allergens" PRIMARY KEY ("Id")
);

CREATE TABLE "Appointments" (
    "Id" integer GENERATED BY DEFAULT AS IDENTITY,
    "PatientId" integer NOT NULL,
    "DoctorId" integer NOT NULL,
    "RoomId" integer NOT NULL,
    "isCancelled" boolean NOT NULL,
    "isDone" boolean NOT NULL,
    "Date" timestamp without time zone NOT NULL,
    "SurveyId" integer NOT NULL,
    CONSTRAINT "PK_Appointments" PRIMARY KEY ("Id")
);

CREATE TABLE "Buildings" (
    "Id" integer GENERATED BY DEFAULT AS IDENTITY,
    "Name" text NULL,
    "Type" integer NOT NULL,
    "X" real NOT NULL,
    "Y" real NOT NULL,
    "Width" real NOT NULL,
    "Height" real NOT NULL,
    CONSTRAINT "PK_Buildings" PRIMARY KEY ("Id")
);

CREATE TABLE "CanceledAppointments" (
    "PatientId" integer NOT NULL,
    "AppointmentId" integer NOT NULL,
    "DateOfCancellation" timestamp without time zone NOT NULL,
    CONSTRAINT "PK_CanceledAppointments" PRIMARY KEY ("PatientId", "AppointmentId")
);

CREATE TABLE "Doctors" (
    "Id" integer GENERATED BY DEFAULT AS IDENTITY,
    "WorkShiftId" integer NOT NULL,
    "Specialty" text NULL,
    "PrimaryRoom" integer NOT NULL,
    "Name" text NULL,
    "Surname" text NULL,
    "BirthDate" timestamp without time zone NOT NULL,
    "Phone" text NULL,
    "Username" text NULL,
    "Email" text NULL,
    "Gender" text NULL,
    "Password" text NULL,
    "Address" text NULL,
    "Salary" double precision NOT NULL,
    "EmploymentDate" timestamp without time zone NOT NULL,
    CONSTRAINT "PK_Doctors" PRIMARY KEY ("Id")
);

CREATE TABLE "Equipments" (
    "Id" integer GENERATED BY DEFAULT AS IDENTITY,
    "Name" text NULL,
    "Type" integer NOT NULL,
    "Quantity" integer NOT NULL,
    "RoomId" integer NOT NULL,
    CONSTRAINT "PK_Equipments" PRIMARY KEY ("Id")
);

CREATE TABLE "FeedbackMessages" (
    "Id" integer GENERATED BY DEFAULT AS IDENTITY,
    "Date" timestamp without time zone NOT NULL,
    "Text" text NULL,
    "IsAnonymous" boolean NOT NULL,
    "Identity" text NULL,
    "CanBePublished" boolean NOT NULL,
    "IsPublished" boolean NOT NULL,
    CONSTRAINT "PK_FeedbackMessages" PRIMARY KEY ("Id")
);

CREATE TABLE "Floors" (
    "Id" integer GENERATED BY DEFAULT AS IDENTITY,
    "Name" text NULL,
    "BuildingId" integer NOT NULL,
    "X" real NOT NULL,
    "Y" real NOT NULL,
    "Width" real NOT NULL,
    "Height" real NOT NULL,
    CONSTRAINT "PK_Floors" PRIMARY KEY ("Id")
);

CREATE TABLE "Medicines" (
    "Id" integer GENERATED BY DEFAULT AS IDENTITY,
    "Name" text NULL,
    "Quantity" integer NOT NULL,
    "Manufacturer" text NULL,
    "Usage" text NULL,
    "Weight" integer NOT NULL,
    "SideEffects" text NULL,
    "Reactions" text NULL,
    "CompatibileMedicine" text NULL,
    "Price" double precision NOT NULL,
    CONSTRAINT "PK_Medicines" PRIMARY KEY ("Id")
);

CREATE TABLE "OnCallShifts" (
    "Id" integer GENERATED BY DEFAULT AS IDENTITY,
    "Date" timestamp without time zone NOT NULL,
    "DoctorId" integer NOT NULL,
    CONSTRAINT "PK_OnCallShifts" PRIMARY KEY ("Id")
);

CREATE TABLE "Renovations" (
    "Id" integer GENERATED BY DEFAULT AS IDENTITY,
    "FirstRoomId" integer NOT NULL,
    "SecondRoomId" integer NOT NULL,
    "Date" timestamp without time zone NOT NULL,
    "Duration" integer NOT NULL,
    "Type" integer NOT NULL,
    CONSTRAINT "PK_Renovations" PRIMARY KEY ("Id")
);

CREATE TABLE "Rooms" (
    "Id" integer GENERATED BY DEFAULT AS IDENTITY,
    "Type" integer NOT NULL,
    "Name" text NULL,
    "Description" text NULL,
    "FloorId" integer NOT NULL,
    "X" real NOT NULL,
    "Y" real NOT NULL,
    "Width" real NOT NULL,
    "Height" real NOT NULL,
    CONSTRAINT "PK_Rooms" PRIMARY KEY ("Id")
);

CREATE TABLE "TenderResponses" (
    "Id" integer GENERATED BY DEFAULT AS IDENTITY,
    "TenderId" integer NOT NULL,
    "PharmacyName" text NULL,
    "TotalPrice_Amount" double precision NULL,
    "Description" text NULL,
    "IsWinningBid" boolean NOT NULL,
    CONSTRAINT "PK_TenderResponses" PRIMARY KEY ("Id")
);

CREATE TABLE "Tenders" (
    "Id" integer GENERATED BY DEFAULT AS IDENTITY,
    "DateRange_Start" timestamp without time zone NULL,
    "DateRange_End" timestamp without time zone NULL,
    "Description" text NULL,
    CONSTRAINT "PK_Tenders" PRIMARY KEY ("Id")
);

CREATE TABLE "Transfer" (
    "Id" integer GENERATED BY DEFAULT AS IDENTITY,
    "Equipment" text NULL,
    "Quantity" integer NOT NULL,
    "SourceRoomId" integer NOT NULL,
    "DestinationRoomId" integer NOT NULL,
    "Date" timestamp without time zone NOT NULL,
    "Duration" integer NOT NULL,
    CONSTRAINT "PK_Transfer" PRIMARY KEY ("Id")
);

CREATE TABLE "Vacations" (
    "Id" integer GENERATED BY DEFAULT AS IDENTITY,
    "Description" text NULL,
    "StartTime" timestamp without time zone NOT NULL,
    "EndTime" timestamp without time zone NOT NULL,
    "DoctorId" integer NOT NULL,
    CONSTRAINT "PK_Vacations" PRIMARY KEY ("Id")
);

CREATE TABLE "WorkDayShift" (
    "Id" integer GENERATED BY DEFAULT AS IDENTITY,
    "Name" text NULL,
    "StartTime" timestamp without time zone NOT NULL,
    "EndTime" timestamp without time zone NOT NULL,
    CONSTRAINT "PK_WorkDayShift" PRIMARY KEY ("Id")
);

CREATE TABLE "Surveys" (
    "Id" integer GENERATED BY DEFAULT AS IDENTITY,
    "AppointmentId" integer NOT NULL,
    "Done" boolean NOT NULL,
    CONSTRAINT "PK_Surveys" PRIMARY KEY ("Id"),
    CONSTRAINT "FK_Surveys_Appointments_AppointmentId" FOREIGN KEY ("AppointmentId") REFERENCES "Appointments" ("Id") ON DELETE CASCADE
);

CREATE TABLE "Day" (
    "DayId" integer GENERATED BY DEFAULT AS IDENTITY,
    "Spec_Day" timestamp without time zone NOT NULL,
    "DoctorId" integer NOT NULL,
    CONSTRAINT "PK_Day" PRIMARY KEY ("DayId"),
    CONSTRAINT "FK_Day_Doctors_DoctorId" FOREIGN KEY ("DoctorId") REFERENCES "Doctors" ("Id") ON DELETE CASCADE
);

CREATE TABLE "Patients" (
    "Id" integer GENERATED BY DEFAULT AS IDENTITY,
    "ParentName" text NULL,
    "DateOfRegistration" timestamp without time zone NOT NULL,
    "IsBlocked" boolean NOT NULL,
    "IsActive" boolean NOT NULL,
    "BloodType" text NULL,
    "Name" text NULL,
    "Surname" text NULL,
    "BirthDate" timestamp without time zone NOT NULL,
    "Phone" text NULL,
    "Email" text NULL,
    "Gender" text NULL,
    "Username" text NULL,
    "Password" text NULL,
    "Address" text NULL,
    "EmploymentStatus" text NULL,
    "Hashcode" text NULL,
    "DoctorId" integer NOT NULL,
    CONSTRAINT "PK_Patients" PRIMARY KEY ("Id"),
    CONSTRAINT "FK_Patients_Doctors_DoctorId" FOREIGN KEY ("DoctorId") REFERENCES "Doctors" ("Id") ON DELETE CASCADE
);

CREATE TABLE "WorkDay" (
    "Id" integer GENERATED BY DEFAULT AS IDENTITY,
    "Day" integer NOT NULL,
    "StartTime" timestamp without time zone NOT NULL,
    "EndTime" timestamp without time zone NOT NULL,
    "DoctorId" integer NULL,
    CONSTRAINT "PK_WorkDay" PRIMARY KEY ("Id"),
    CONSTRAINT "FK_WorkDay_Doctors_DoctorId" FOREIGN KEY ("DoctorId") REFERENCES "Doctors" ("Id") ON DELETE RESTRICT
);

CREATE TABLE "TenderResponses_TenderItems" (
    "Id" integer GENERATED BY DEFAULT AS IDENTITY,
    "TenderResponseId" integer NOT NULL,
    "Name" text NULL,
    "Quantity" integer NOT NULL,
    CONSTRAINT "PK_TenderResponses_TenderItems" PRIMARY KEY ("TenderResponseId", "Id"),
    CONSTRAINT "FK_TenderResponses_TenderItems_TenderResponses_TenderResponseId" FOREIGN KEY ("TenderResponseId") REFERENCES "TenderResponses" ("Id") ON DELETE CASCADE
);

CREATE TABLE "Tenders_TenderItems" (
    "Id" integer GENERATED BY DEFAULT AS IDENTITY,
    "TenderId" integer NOT NULL,
    "Name" text NULL,
    "Quantity" integer NOT NULL,
    CONSTRAINT "PK_Tenders_TenderItems" PRIMARY KEY ("TenderId", "Id"),
    CONSTRAINT "FK_Tenders_TenderItems_Tenders_TenderId" FOREIGN KEY ("TenderId") REFERENCES "Tenders" ("Id") ON DELETE CASCADE
);

CREATE TABLE "SurveyCategories" (
    "Id" integer GENERATED BY DEFAULT AS IDENTITY,
    "Name" text NULL,
    "SurveyId" integer NOT NULL,
    CONSTRAINT "PK_SurveyCategories" PRIMARY KEY ("Id"),
    CONSTRAINT "FK_SurveyCategories_Surveys_SurveyId" FOREIGN KEY ("SurveyId") REFERENCES "Surveys" ("Id") ON DELETE CASCADE
);

CREATE TABLE "AllergenForPatients" (
    "PatientId" integer NOT NULL,
    "AllergenId" integer NOT NULL,
    "Name" text NULL,
    CONSTRAINT "PK_AllergenForPatients" PRIMARY KEY ("PatientId", "AllergenId"),
    CONSTRAINT "FK_AllergenForPatients_Patients_PatientId" FOREIGN KEY ("PatientId") REFERENCES "Patients" ("Id") ON DELETE CASCADE
);

CREATE TABLE "Prescriptions" (
    "Id" integer GENERATED BY DEFAULT AS IDENTITY,
    "Diagnosis" text NULL,
    "Medicine" text NULL,
    "Quantity" integer NOT NULL,
    "Date" timestamp without time zone NOT NULL,
    "PatientId" integer NOT NULL,
    CONSTRAINT "PK_Prescriptions" PRIMARY KEY ("Id"),
    CONSTRAINT "FK_Prescriptions_Patients_PatientId" FOREIGN KEY ("PatientId") REFERENCES "Patients" ("Id") ON DELETE CASCADE
);

CREATE TABLE "SurveyQuestions" (
    "Id" integer GENERATED BY DEFAULT AS IDENTITY,
    "Content" text NULL,
    "Grade" integer NOT NULL,
    "SurveyCategoryId" integer NOT NULL,
    CONSTRAINT "PK_SurveyQuestions" PRIMARY KEY ("Id"),
    CONSTRAINT "FK_SurveyQuestions_SurveyCategories_SurveyCategoryId" FOREIGN KEY ("SurveyCategoryId") REFERENCES "SurveyCategories" ("Id") ON DELETE CASCADE
);

